"""
You are given an array of strings words and a string chars.

A string is good if it can be formed by characters from chars (each character can only be used once).

Return the sum of lengths of all good strings in words.



Example 1:

Input: words = ["cat","bt","hat","tree"], chars = "atach"
Output: 6
Explanation:
The strings that can be formed are "cat" and "hat" so the answer is 3 + 3 = 6.
Example 2:

Input: words = ["hello","world","leetcode"], chars = "welldonehoneyr"
Output: 10
Explanation:
The strings that can be formed are "hello" and "world" so the answer is 5 + 5 = 10.


Note:

1 <= words.length <= 1000
1 <= words[i].length, chars.length <= 100
All strings contain lowercase English letters only.
"""

class TrieNode:
    def __init__(self, value = None):
        self.value = value
        self.next = {}
        self.end = 0

class Trie:
    def __init__(self):
        self.root = None
    def insert(self, word):
        if self.root == None:
            self.root = TrieNode()
        current = self.root
        for char in word:
            if char not in current.next:
                current.next[char] = TrieNode(char)
            current = current.next[char]
        current.end += 1



class Solution:
    def countCharacters(self, words, chars):
        #Initialize output
        #Initialize depth
        #Initialize currentChars, frequency dictionary of chars
        #Place all of the words into a trie
        #Make a recursive function that does the following:
            #If you're at an endpoint, adds the depth to output
            #Regardless, iterate through chars in dictionary that have freq > 0
                #If the char is in current's .next
                    #Add 1 to depth
                    #Subtract the next char from currentChars
                    #Call the function again on the next char's trieNode
                    #Add next char back into currentChar
                    #Reduce depth by 1
        #Return output

        output = 0
        previous = []
        currentChars = {}
        for char in chars:
            if char not in currentChars:
                currentChars[char] = 1
            else:
                currentChars[char] += 1
        trie = Trie()
        for word in words:
            if len(word) <= len(chars):
                trie.insert(word)
        def traverseChar(node):
            nonlocal output
            nonlocal previous
            nonlocal currentChars
            if node.end > 0:
                output += len(previous) * node.end
            for char in node.next:
                if char in currentChars:
                    if currentChars[char] > 0:
                        previous.append(char)
                        currentChars[char] -= 1
                        traverseChar(node.next[char])
                        currentChars[char] += 1
                        previous.pop()
        traverseChar(trie.root)
        return output

